pt the water from the tin can and we made some chocolate mousse. Chickpea water doesn’t smell nice but you’ll won’t taste it don’t worry 🍫 ⠀⠀⠀⠀⠀⠀⠀⠀⠀ ⠀⠀⠀⠀⠀⠀⠀⠀⠀ ⠀⠀⠀⠀⠀⠀⠀⠀⠀ ⠀⠀⠀⠀⠀⠀⠀⠀⠀ ⠀For 3 dessert beat 150ml of chickpea water while adding 30gr of sugar. Add 150gr of melted dark chocolate and add vanilla extract and 1tsp of cinnamon. Put in the fridge for 4h. ⠀⠀⠀⠀⠀⠀⠀⠀⠀ ⠀⠀⠀⠀⠀⠀⠀⠀⠀ ⠀⠀⠀⠀⠀⠀⠀⠀⠀ ⠀⠀⠀⠀⠀⠀⠀⠀⠀ ⠀⠀⠀⠀⠀⠀⠀⠀⠀ ⠀⠀⠀ ⠀⠀⠀⠀⠀⠀⠀⠀⠀ ⠀⠀ ⠀⠀⠀⠀⠀⠀⠀⠀⠀ ⠀⠀ ⠀⠀⠀ #cuisine #cuisinemaison #cooking #french #food #instafoodie #foodstagram #foodlover #foodporn #f4f #tflers #instagood #instalike #pligfr #igersfrance #discoverunder1k #l4l #tasty #france #igersmarseille #planeteig09 #foodie_focus_on #recipe #marmiton #ensembleencuisine #vegan #chickpea #healthy #chocolate";}i:199;a:1:{s:14:"comments_count";i:1;}i:200;a:1:{s:11:"likes_count";i:11;}i:201;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEueOqchgCh";}i:202;a:1:{s:5:"image";s:250:"https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/e35/p1080x1080/118695803_2389466118013688_2156129568166190349_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=108&_nc_ohc=fCXOWIAtKyoAX8lJDsW&oh=c81fab5bc204cb21fde3d8dc7524f73f&oe=5F7BC654";}i:203;a:1:{s:4:"type";s:7:"sidecar";}i:204;a:1:{s:8:"owner_id";i:33923594349;}i:205;a:1:{s:14:"owner_username";s:0:"";}i:206;a:1:{s:14:"owner_fullname";s:0:"";}i:207;a:1:{s:9:"owner_pic";s:0:"";}i:208;a:1:{s:2:"id";s:19:"2390981393609917686";}i:209;a:1:{s:10:"short_code";s:11:"CEueOjWsAT2";}i:210;a:1:{s:12:"created_time";i:1599247214;}i:211;a:1:{s:7:"caption";s:477:"@destinationailleurs04
